import NavbarItem from '../../components/headerconponents/NavBarItem';
import navBar from '../../data/navBar.json'
// import Button from "../../components/headerconponents/Button";
import City from "../../components/headerconponents/City";
import dataCity from '../../data/city.json';
import './home.css';

const Home = (props) => {

	return (
		<div className='header'>


			<NavbarItem items={navBar}></NavbarItem>
			<City items={dataCity}></City>


		</div>
	);
};

export default Home;
